INSERT INTO `mf_system_text` VALUES (1,'Православие','',''),(2,'Посты и трапезы','',''),(3,'Посты','',''),(4,'Великие Праздники','',''),(5,'Мясоеды','',''),(6,'Сплошные седмицы','',''),(7,'Пасха','',''),(8,'Рождество Богородицы','',''),(9,' Водвижение креста господня','',''),(10,'Введение во храм Пресвятой Богородицы','Печатный станок являл собой массивное сооружение, прикрепленное брусьями к полу и потолку. Главной его частью был пресс с рычагом, под которым находился плоский стол - талер. Этот талер был устроен так, что мог выдвигаться из-под пресса. На талер ставили набор двух или нескольких страниц (до 32), сколько их помещалось в зависимости от размера. Краской смазывали все выпуклые части набора. Чтобы бумага при печатании не соскальзывала с набора, использовали специальное приспособление - декель, снабженный двумя или тремя остриями (графейками). Он прикреплялся к передней части талера на шарнирах. Перед началом печатания мастер брал несколько листов бумаги (10-20), тщательно выравнивал их по краям и нанизывал на графейки. Сверху эти листы прикрывались рамкой (рашкетом), которая крепилась к декелю также на шарнирах. Рашкет закрывал поля бумаги и середину листа, то есть все части, которые должны были оставаться чистыми. После этого декель опускался на набор, так что нижний лист плотно прижимался к набору. Талер подвигали под пресс и при помощи рычага прижимали пиан (верхнюю доску) к декелю. Затем пресс поднимали, выдвигали весь аппарат с бумагой, поднимали рашкет и снимали с графеек напечатанный лист. Для того чтобы получить лучший оттиск, бумагу слегка смачивали водой. Поэтому готовые листы просушивали на веревке. После сушки делали оттиск на другой стороне листа. Затем листы поступали к переплетчику.',''),(11,'Рождество христово','',''),(12,'Крещение Господне','',''),(13,'Сретение Господне','',''),(14,'Благовещение Пресвятой Богородицы','',''),(15,'Вход Господень в Иерусалим','',''),(16,'Вознесение Господне','',''),(17,'День святой троицы','',''),(18,' Преображение Господне','',''),(19,'Успение Пресвятой Богородицы','',''),(20,'Покров Пресвятой Богородицы','',''),(21,'Обрезание Господне','',''),(22,'Рождество Иоанна Предтечи','',''),(23,'День апостолов петра и павла','',''),(24,'Усекновение главы иона Предтечи','',''),(25,'рождественский пост','',''),(26,'рождественский пост','Печатание текстов происходило следующим образом. Сначала наборщик набирал текст из свинцовых литер. Строками, как уже говорилось, служили специальные линейки - верстатки. Они представляли собой продолговатую коробочку, открытую сверху и с одного бока. Когда набирался один ряд нужной длины, наборщик выравнивал строку с помощью заключки - уменьшал или увеличивал пробелы между словами вынимая или вставляя шпации - тонкие кусочки словолитного металла без литер, имевшие определенную ширину. После заполнения верстатки ее устанавливали на наборную доску. Когда набор страницы заканчивался, доску брали в рамку, чтобы литеры не рассыпались.','<p>Всякую праздничную трапезу Типикон называет \"великим утешением братии\". Пасха, которая по своему значению выходит из ряда главнейших двунадесятых праздников и именуется \"Праздником праздников и Торжеством торжеств\", предполагает особенно обильную и разнообразную трапезу. Однако, разрешая это утешение, Церковь все же не особенно одобряет изысканные, требующие многих компонентов и сложных в приготовлении блюд, считая изыски кулинарии проявлением греха чревоугодия. На пасхальном столе должно быть нескольких простых, недорогих, но необыкновенно вкусных блюд, которые несут в себе глубокое символическое содержание.</p>\r\n\r\n<p>С началом первой седмицы поста заботливые хозяйки начинают копить луковичное перо, которое лучше всякого импортного порошка окрашивает яйцо в самый правильный густой красно-коричневый цвет. Раскрашивание пасхального яйца — это самое настоящее искусство. Художники-миниатюристы способны изобразить на выпуклой поверхности храмы и монастыри, фантастические букеты, небесные светила, моря, леса, степи и горы, святых и ангелов. Только вся эта живопись — влияние Запада, а настоящее пасхальное яйцо всегда красится луковичным пером!</p>\r\n\r\n<p>Объяснение обычая красить пасхальные яйца в красный цвет восходит к довольно позднему апокрифу, в котором говорится об обращении в христианскую веру Римского императора Тиверия. Желая остановить проповедь Марии Магдалины, Тиверий заявил, что он скорее готов поверить в превращение белого яйца в красное, чем в возможность оживления умершего. Яйцо покраснело, и это стало последним аргументом в полемике, которая завершилась крещением Римского кесаря.</p>\r\n\r\n<p>Обычай обмениваться крашеными яйцами прочно вошел в быт Церкви. Символическое значение яйца как начала новой жизни было известно и ранее. Христиане увидели в этом символе подтверждение своей веры в грядущее всеобщее воскресение. Красный цвет пасхального яйца символизирует всепобеждающую Божественную Любовь, которая одна только может сокрушить ад! </p>\r\n\r\n<p>Пасхальный кулич по своей форме напоминает артос — хлеб, который освящается на пасхальном богослужении и раздается верующим в субботу Светлой седмицы. Пасхальный артос — символ Самого Господа Иисуса Христа. Обращаясь к ученикам, Он говорил: \"Я есмь хлеб жизни... Хлеб, сходящий с небес, таков, что ядущий его не умрет. Я хлеб живый, сшедший с небес; ядущий хлеб сей будет жить во век; хлеб же, который Я дам, есть Плоть Моя, которую Я отдал за жизнь мира\" (Ин. 6, 48-51). Артос всегда приготовляется из дрожжевого теста. Это не иудейский опреснок, в котором нет ничего живого. Это хлеб, в котором дышит закваска, жизнь, которая может длиться вечно. Онтологический статус артоса не позволяет добавлять в него ничего лишнего. В нем нет никакой сдобы, никаких ароматических веществ. Артос — это символ самого насущного хлеба — Христа Спасителя, Который есть Жизнь!</p>\r\n\r\n<p>Однако в пасхальном куличе, этом артосе, перенесенном на праздничный стол, напротив, присутствует и сдоба, и сладость, и изюм, и орехи. Правильно приготовленный русский кулич не черствеет неделями; он ароматен, красив, тяжел и может простоять, не испортившись, все сорок дней Пасхи. Такое видоизменение артоса тоже имеет символическую основу. Пасхальный кулич на праздничном столе символизирует присутствие Божие в мире и в человеческой жизни. Сладость, сдоба, красота пасхального кулича, таким образом, выражают заботу Господа о всяком человеческом существе, Его сострадание, милосердие, снисхождение к немощам человеческого естества, готовность услышать любую молитву, придти на помощь последнему грешнику.</p>\r\n\r\n<p>Наименование Господа Иисусом Сладчайшим в одном из древнейших акафистов помогает понять символику пасхального кулича.</p>\r\n\r\n<p>Столь же ароматной и преукрашенной является еще одна непременная принадлежность пасхального стола — творожная пасха, которая также имеет свою глубокую, укорененную в Священном Писании символику. Земля, где в кисельных берегах текут молочные реки, является одним из наиболее распространенных архетипов, характерных для самых разных культур. Молочные реки в кисельных берегах были вековечной мечтой русского крестьянина, которая воплотилась в сказках и народных песнях.</p>\r\n\r\n<p>Господь, обращаясь к Моисею, обещает Своему избранному народу \"землю хорошую и пространную, где течет молоко и мед\" (Исх. 2, 7). Эта характеристика земли обетованной сохраняется на протяжении всего повествования о Пасхе — переходе евреев из Египта в Палестину. Она является прообразом Царства Небесного, путь в которое для верующего человека еще более труден, чем сорокалетнее путешествие иудеев. Ее \"молоко и мед\" — образ нескончаемой радости, блаженства святых, удостоенных спасения и вечного пребывания перед престолом Божиим.</p>\r\n\r\n<p>Таким образом, творожная пасха — это символ пасхального веселья, сладости райской жизни, блаженной Вечности, которая не является бесконечным длящимся временем, бессмысленным повторением одного и того же, но, по пророчеству Апокалипсиса, \"новым небом и новой землей\". А \"горка\", форма, в которую укладывается пасха — это символ Небесного Сиона, незыблемого основания Нового Иерусалима — города, в котором нет храма, но \"Сам Господь Бог Вседержитель — храм его и Агнец\" (Апок. 21, 22).</p>'),(27,'великий пост','',''),(28,'петров пост','',''),(29,'успенскиий пост','',''),(30,'Осенний мясоед','',''),(31,'Осенний мясоед','',''),(32,'Зимний мясоед','',''),(33,'Весенний мясоед','',''),(34,'Весенний мясоед','',''),(35,'Летний мясоед','',''),(36,'Святки','',''),(37,'Неделя Мытаря и фарисея','',''),(38,'Седмица сырная (масленица)','',''),(39,'Пасхальная неделя','',''),(40,'Троицкая неделя','',''),(1014,'Дни четырдясятныцы','',''),(1015,'Неделя мытаря и фарисея','',''),(1016,'Неделя о блудном сыне','',''),(1017,'Мясопустная вселенская родительская суббота','',''),(1018,'Неделя о Страшном суде','',''),(1019,'Прощеное воскресенье','',''),(1020,'Торжество православия','',''),(1021,'Родительская вселенская суббота','',''),(1022,'Неделя святителя Григория Паламы','',''),(1023,'Неделя Крестопоклонная','',''),(1024,'Неделя Преподобного Иоанна Лествичника','',''),(1025,'Марьино стояние','',''),(1026,'Суббота акафиста','',''),(1027,'Неделя Преподобной Марии Египетской','',''),(1028,'Лазарева суббота','',''),(1029,'мясопустная седмица','',''),(1030,'Страстная седмица','',''),(1031,'Страстная седмица','',''),(1032,'страстной понедельник','',''),(1033,'страстной вторник','',''),(1034,'страстная среда','',''),(1035,'страстной четверг','',''),(1036,'страстная пятница','',''),(1037,'страстная суббота','',''),(1038,'Еженедельный пост','',''),(1039,'Рождественский сочельник','',''),(1040,'Богоявленский сочельник','',''),(1041,'радоница','',''),(1042,'день поминовения всех погибших в годы Великой Отечественной войны','',''),(1043,'Троицкая вселенская родительская суббота','',''),(1044,'Димитриевская суббота','',''),(1045,'Дни святых','',''),(1046,'Апостола и евангелиста Иоанна Богослова','',''),(1047,'Святителя Николая, архиепископа Мир Ликийских, 